          <source src="/path/to/your/video.webm" type="video/webm" />
          {/* Fallback content for browsers that do not support video */}
          Your browser does not support the video tag.
        </video>
        <div className="content">
          {/* Your other content goes here */}
        </div>
      </div>
    );
}

export default hero;
